<div class="text_cell_render border-box-sizing rendered_html">
<h1 id="Covid19">Covid19<a class="anchor-link" href="#Covid19">&#182;</a></h1><p>This notebook is an example on how to use the Vertica ML Python Library. We will use the Covid19 dataset to predict the number of deaths and cases one day in advance. You can download the Jupyter Notebook of the study by clicking <a href="covid19.ipynb">here</a>. To achieve our goals, we have access to the following data.</p>
<p><ul class="ul_content">
    <li><b>date: </b>Date of the record</li>
    <li><b>cases: </b>Number of people infected by the virus</li>
    <li><b>deaths: </b>Number of deaths</li>
    <li><b>state: </b>State</li>
    <li><b>county: </b>County</li>
</ul></p>
<p>The dataset is available by clicking <a href="../../data/covid19_deaths.csv">here</a>.</p>
<p>We will follow the entire Data Science cycle (Data Exploration - Data Preparation - Data Modeling - Model Evaluation - Model Deployment) and solve this easy use-case. The purpose is to show you some of the library interesting functionalities.</p>
