<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<h2 id="Machine-Learning">Machine Learning<a class="anchor-link" href="#Machine-Learning">&#182;</a></h2>
</div>
</div>
</div>
<div class="cell border-box-sizing text_cell rendered"><div class="prompt input_prompt">
</div>
<div class="inner_cell">
<div class="text_cell_render border-box-sizing rendered_html">
<p>Let's create a Linear Regression model to predict the number of Covid19 deaths in advance by state.</p>

</div>
</div>
</div>
<div class="cell border-box-sizing code_cell rendered">
<div class="input">
<div class="prompt input_prompt">In&nbsp;[16]:</div>
<div class="inner_cell">
    <div class="input_area">
<div class=" highlight hl-ipython3"><pre><span></span><span class="kn">from</span> <span class="nn">vertica_ml_python.learn.linear_model</span> <span class="k">import</span> <span class="n">LinearRegression</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python.learn.model_selection</span> <span class="k">import</span> <span class="n">cross_validate</span>
<span class="kn">from</span> <span class="nn">vertica_ml_python.utilities</span> <span class="k">import</span> <span class="n">drop_model</span>

<span class="n">predictors</span> <span class="o">=</span> <span class="n">covid19</span><span class="o">.</span><span class="n">get_columns</span><span class="p">(</span><span class="n">exclude_columns</span> <span class="o">=</span> <span class="p">[</span><span class="s2">&quot;state&quot;</span><span class="p">,</span> 
                                                    <span class="s2">&quot;date&quot;</span><span class="p">,</span> 
                                                    <span class="s2">&quot;deaths&quot;</span><span class="p">,</span> 
                                                    <span class="s2">&quot;cases&quot;</span><span class="p">])</span>
<span class="n">response</span> <span class="o">=</span> <span class="s2">&quot;deaths&quot;</span>
<span class="n">relation</span> <span class="o">=</span> <span class="s2">&quot;covid19_clean&quot;</span>
<span class="n">drop_model</span><span class="p">(</span><span class="s2">&quot;covid19_lr&quot;</span><span class="p">)</span>
<span class="n">model</span> <span class="o">=</span> <span class="n">LinearRegression</span><span class="p">(</span><span class="s2">&quot;covid19_lr&quot;</span><span class="p">)</span>
<span class="n">cross_validate</span><span class="p">(</span><span class="n">model</span><span class="p">,</span> <span class="n">relation</span><span class="p">,</span> <span class="n">predictors</span><span class="p">,</span> <span class="n">response</span><span class="p">)</span>
</pre></div>

</div>
</div>
</div>

