<span class="n">model</span><span class="o">.</span><span class="n">fit</span><span class="p">(</span><span class="n">relation</span><span class="p">,</span> 
          <span class="p">[</span><span class="s2">&quot;lag_deaths_1&quot;</span><span class="p">,</span>
           <span class="s2">&quot;lag_deaths_2&quot;</span><span class="p">,</span>
           <span class="s2">&quot;lag_cases_1&quot;</span><span class="p">,</span>
           <span class="s2">&quot;lag_cases_2&quot;</span><span class="p">,</span>
           <span class="s2">&quot;lag_cases_3&quot;</span><span class="p">,</span>
           <span class="s2">&quot;lag_cases_4&quot;</span><span class="p">],</span> 
          <span class="n">response</span><span class="p">)</span>
<span class="n">x</span> <span class="o">=</span> <span class="n">model</span><span class="o">.</span><span class="n">features_importance</span><span class="p">()</span>
